import React, { useState } from 'react';
import { useContacts } from '../../hooks/useContacts';
import './Contacts.css';

const Contacts = () => {
  const { contacts, loading, error, addContact, updateContact, deleteContact } = useContacts();
  const [editingId, setEditingId] = useState(null);
  const [newContact, setNewContact] = useState({
    email: '',
    phone: '',
    dtc_number: '',
    mpid: '',
    counterparty_name: '',
    product: ''
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    const result = await addContact(newContact);
    if (result.success) {
      setNewContact({
        email: '',
        phone: '',
        dtc_number: '',
        mpid: '',
        counterparty_name: '',
        product: ''
      });
    }
  };

  const handleUpdate = async (id, updatedContact) => {
    const result = await updateContact(id, updatedContact);
    if (result.success) {
      setEditingId(null);
    }
  };

  if (loading) {
    return (
      <div className="contacts-container">
        <div className="loading-message">Loading contacts...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="contacts-container">
        <div className="error-message">
          <h3>Error Loading Contacts</h3>
          <p>{error}</p>
          <button onClick={() => window.location.reload()}>Retry</button>
        </div>
      </div>
    );
  }

  return (
    <div className="contacts-container">
      <form onSubmit={handleSubmit} className="contact-form">
        <input
          type="email"
          placeholder="Email"
          value={newContact.email}
          onChange={(e) => setNewContact({...newContact, email: e.target.value})}
          required
        />
        <input
          type="tel"
          placeholder="Phone"
          value={newContact.phone}
          onChange={(e) => setNewContact({...newContact, phone: e.target.value})}
          required
        />
        <input
          type="text"
          placeholder="DTC Number"
          value={newContact.dtc_number}
          onChange={(e) => setNewContact({...newContact, dtc_number: e.target.value})}
        />
        <input
          type="text"
          placeholder="MPID"
          value={newContact.mpid}
          onChange={(e) => setNewContact({...newContact, mpid: e.target.value})}
        />
        <input
          type="text"
          placeholder="Counterparty Name"
          value={newContact.counterparty_name}
          onChange={(e) => setNewContact({...newContact, counterparty_name: e.target.value})}
          required
        />
        <input
          type="text"
          placeholder="Product"
          value={newContact.product}
          onChange={(e) => setNewContact({...newContact, product: e.target.value})}
          required
        />
        <button type="submit">Add Contact</button>
      </form>

      <div className="contacts-list">
        {contacts.length === 0 ? (
          <div className="no-contacts">No contacts found. Add one above!</div>
        ) : (
          contacts.map(contact => (
            <div key={contact.id} className="contact-card">
              {editingId === contact.id ? (
                <div className="edit-form">
                  <input
                    type="email"
                    value={contact.email}
                    onChange={(e) => handleUpdate(contact.id, { ...contact, email: e.target.value })}
                  />
                  <input
                    type="tel"
                    value={contact.phone}
                    onChange={(e) => handleUpdate(contact.id, { ...contact, phone: e.target.value })}
                  />
                  <input
                    type="text"
                    value={contact.dtc_number || ''}
                    onChange={(e) => handleUpdate(contact.id, { ...contact, dtc_number: e.target.value })}
                    placeholder="DTC Number"
                  />
                  <input
                    type="text"
                    value={contact.mpid || ''}
                    onChange={(e) => handleUpdate(contact.id, { ...contact, mpid: e.target.value })}
                    placeholder="MPID"
                  />
                  <input
                    type="text"
                    value={contact.counterparty_name}
                    onChange={(e) => handleUpdate(contact.id, { ...contact, counterparty_name: e.target.value })}
                    placeholder="Counterparty Name"
                  />
                  <input
                    type="text"
                    value={contact.product}
                    onChange={(e) => handleUpdate(contact.id, { ...contact, product: e.target.value })}
                    placeholder="Product"
                  />
                  <button onClick={() => setEditingId(null)}>Save</button>
                </div>
              ) : (
                <>
                  <h3>{contact.counterparty_name}</h3>
                  <p><strong>Email:</strong> {contact.email}</p>
                  <p><strong>Phone:</strong> {contact.phone}</p>
                  {contact.dtc_number && <p><strong>DTC:</strong> {contact.dtc_number}</p>}
                  {contact.mpid && <p><strong>MPID:</strong> {contact.mpid}</p>}
                  <p><strong>Product:</strong> {contact.product}</p>
                  <div className="contact-actions">
                    <button onClick={() => setEditingId(contact.id)}>Edit</button>
                    <button onClick={() => deleteContact(contact.id)}>Delete</button>
                  </div>
                </>
              )}
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default Contacts;
